webpackJsonp([0x8557d52f2091],{356:function(A,a){A.exports={data:{site:{siteMetadata:{title:"Blog by Jingzhou Luo",subtitle:"Also go by Joe. Software Engineer, Seahawk Fan, Spicy Foody",copyright:"© All rights reserved.",author:{name:"Jingzhou Luo",twitter:"#"}}},markdownRemark:{id:"/Users/jingzhou/repos/jingzhou-blog/src/pages/articles/2018-02-11---Origin-Of-The-Blog/index.md absPath of file >>> MarkdownRemark",html:'<p>I agree with one theory that successful individuals are disciplined and have full autonomy. However people usually develop autonomy from heteronomy. For instance when we study with classmates and work with teammates, we are motivated to be a better person from others inspiration and expectation. So I just want to start using this blog to leverage internet’s heteronomy to motivate myself to write more and track learnings, bookings, feelings.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/1-a3057b79175cdcf4a107e8cc2c8f8325-5b032.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 960px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="1"\n        title=""\n        src="/static/1-a3057b79175cdcf4a107e8cc2c8f8325-d564d.jpg"\n        srcset="/static/1-a3057b79175cdcf4a107e8cc2c8f8325-865fd.jpg 240w,\n/static/1-a3057b79175cdcf4a107e8cc2c8f8325-d40a0.jpg 480w,\n/static/1-a3057b79175cdcf4a107e8cc2c8f8325-d564d.jpg 960w,\n/static/1-a3057b79175cdcf4a107e8cc2c8f8325-c67c1.jpg 1440w,\n/static/1-a3057b79175cdcf4a107e8cc2c8f8325-5b032.jpg 1800w"\n        sizes="(max-width: 960px) 100vw, 960px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>自律还需他律，互联网就是最理想的他律约束工具。希望利用这个博客来记录所思所学，也希望能鞭策自己多学多用，不断分析总结。</br>\n之前也开过博客，但是技术为主的博客，这是第一次。用Gatsby/React构建，也提供了扩展和定制的机会。共勉！</p>',fields:{tagSlugs:["/tags/中文/","/tags/learning-to-write/","/tags/杂文/"]},frontmatter:{title:"博客开篇",tags:["中文","Learning to write","杂文"],date:"2018-02-11T12:41:00.000Z",description:"自律还需他律，互联网就是最理想的他律约束工具。希望利用这个博客来记录所思所学，也希望能鞭策自己多学多用，不断分析总结。 之前也开过博客，但是技术为主的博客，这是第一次。用Gatsby/React构建，也提供了扩展和定制的机会。共勉！"}}},pathContext:{slug:"/posts/origin-of-the-blog/"}}}});
